/* Slider */
.slick-slider {
  position: relative;
  display: block;
  -moz-box-sizing: border-box;
  box-sizing: border-box;
  -webkit-touch-callout: none;
  -webkit-user-select: none;
  -khtml-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
  -ms-touch-action: pan-y;
  touch-action: pan-y;
  -webkit-tap-highlight-color: transparent; }

.slick-list {
  position: relative;
  overflow: hidden;
  display: block;
  margin: 0;
  padding: 0; }
.slick-list:focus {
  outline: none; }
.slick-list.dragging {
  cursor: pointer;
  cursor: hand; }

.slick-slider .slick-track,
.slick-slider .slick-list {
  -webkit-transform: translate3d(0, 0, 0);
  -moz-transform: translate3d(0, 0, 0);
  -ms-transform: translate3d(0, 0, 0);
  -o-transform: translate3d(0, 0, 0);
  transform: translate3d(0, 0, 0); }

.slick-track {
  position: relative;
  left: 0;
  top: 0;
  display: block; }
.slick-track:before, .slick-track:after {
  content: "";
  display: table; }
.slick-track:after {
  clear: both; }
.slick-loading .slick-track {
  visibility: hidden; }

.slick-slide {
  float: left;
  height: 100%;
  min-height: 1px;
  display: none; }
[dir="rtl"] .slick-slide {
  float: right; }
.slick-slide img {
  display: block; }
.slick-slide.slick-loading img {
  display: none; }
.slick-slide.dragging img {
  pointer-events: none; }
.slick-initialized .slick-slide {
  display: block; }
.slick-loading .slick-slide {
  visibility: hidden; }
.slick-vertical .slick-slide {
  display: block;
  height: auto;
  border: 1px solid transparent; }

.slick-arrow.slick-hidden {
  display: none; }

.Carousel--hero .slick-slider {
  margin-bottom: 0; }
.Carousel--hero .slick-slider .slick-slide {
  position: relative;
  padding-bottom: 0 !important; }
.Carousel--hero .slick-slider .slick-slide img.slick-loading {
  border: 0; }
.Carousel--hero .slick-slider .slick-dots {
  margin-left: 0;
  position: absolute;
  bottom: 5px;
  list-style: none;
  display: block;
  text-align: center;
  padding: 0;
  width: 100%; }
.Carousel--hero .slick-slider .slick-dots li {
  position: relative;
  display: inline-block;
  height: 20px;
  width: 20px;
  margin: 0 2px;
  padding: 0;
  cursor: pointer; }
.Carousel--hero .slick-slider .slick-dots li button {
  border: 0;
  background: transparent;
  display: block;
  height: 20px;
  width: 20px;
  outline: none;
  line-height: 0;
  font-size: 0;
  color: transparent;
  padding: 5px;
  cursor: pointer; }
.Carousel--hero .slick-slider .slick-dots li button:focus, .Carousel--hero .slick-slider .slick-dots li button:hover {
  outline: none; }
.Carousel--hero .slick-slider .slick-dots li button:focus:before, .Carousel--hero .slick-slider .slick-dots li button:hover:before {
  opacity: 1; }
.Carousel--hero .slick-slider .slick-dots li button:before {
  -webkit-transition: opacity 0.4s ease;
  -moz-transition: opacity 0.4s ease;
  -o-transition: opacity 0.4s ease;
  -ms-transition: opacity 0.4s ease;
  transition: opacity 0.4s ease;
  position: absolute;
  top: 0;
  left: 0;
  content: " ";
  background-color: #fff;
  display: block;
  width: 12px;
  height: 12px;
  line-height: 12px;
  -webkit-border-radius: 12px;
  -moz-border-radius: 12px;
  -o-border-radius: 12px;
  -ms-border-radius: 12px;
  border-radius: 12px;
  text-align: center;
  opacity: 0.5; }
.Carousel--hero .slick-slider .slick-dots li.slick-active button:before {
  opacity: 1; }
.Carousel--hero .slick-slider .slick-prev,
.Carousel--hero .slick-slider .slick-next {
  position: absolute;
  display: block;
  height: 100%;
  width: 20px;
  line-height: 0px;
  font-size: 0px;
  cursor: pointer;
  background: transparent;
  color: transparent;
  top: 50%;
  margin-top: -10px\9;
  /*lte IE 8*/
  -webkit-transform: translate(0, -50%);
  -ms-transform: translate(0, -50%);
  transform: translate(0, -50%);
  padding: 0;
  border: none;
  outline: none;
  opacity: 0.5;
  -webkit-transition: opacity 400ms ease;
  -moz-transition: opacity 400ms ease;
  -o-transition: opacity 400ms ease; }
.Carousel--hero .slick-slider .slick-prev:hover,
.Carousel--hero .slick-slider .slick-next:hover {
  opacity: 1; }
.Carousel--hero .slick-slider .slick-prev:before,
.Carousel--hero .slick-slider .slick-next:before {
  display: none !important; }
.Carousel--hero .slick-slider .slick-prev {
  left: 0; }
.Carousel--hero .slick-slider .slick-next {
  right: 0; }
.Carousel--hero .slick-slider li {
  cursor: default !important; }
.Carousel--hero .slick-slider .Carousel--text-container {
  display: block;
  padding: 10px; }
.Carousel--hero .slick-slider .Carousel--text-container h1 {
  color: #000;
  font-size: 24px;
  margin: 0 0 10px;
  line-height: 28px; }
.Carousel--hero .slick-slider .Carousel--text-container .Carousel--details {
  font-size: 16px;
  line-height: 22px; }
.Carousel--hero .slick-slider .Carousel--text-container .Carousel--learnMoreLink {
  display: block;
  padding: 6px 0 0;
  font-size: 16px;
  font-weight: bold;
  line-height: 1.2;
  text-decoration: none;
  color: #0068b3;
  cursor: pointer; }
.Carousel--hero .slick-slider .slick-prev {
  left: -20px; }
@media screen and (max-width: 767px) {
  .Carousel--hero .slick-slider .slick-prev {
    display: none !important; } }
.Carousel--hero .slick-slider .slick-next {
  right: -20px; }
@media screen and (max-width: 767px) {
  .Carousel--hero .slick-slider .slick-next {
    display: none !important; } }
.Carousel--hero .slick-slider .slick-slide img {
  width: 100%; }
.Carousel--hero .slick-slider .slick-slide .Carousel--text-container {
  width: 300px;
  position: absolute;
  top: 50%;
  margin-top: -105px;
  min-height: 170px;
  width: 352px;
  opacity: .9;
  background-color: #fff;
  color: #000;
  filter: alpha(opacity=90); }
@media screen and (max-width: 767px) {
  .Carousel--hero .slick-slider .slick-slide .Carousel--text-container {
    display: block;
    position: static;
    width: auto;
    height: auto;
    min-height: auto;
    padding: 7px 10px;
    margin: 0; }
  .Carousel--hero .slick-slider .slick-slide .Carousel--text-container .Carousel--details {
    display: none; } }
.Carousel--hero .slick-slider .slick-slide .Carousel--slide-inner.Carousel--align-left .Carousel--text-container {
  left: 0; }
.Carousel--hero .slick-slider .slick-slide .Carousel--slide-inner.Carousel--align-right .Carousel--text-container {
  right: 0; }
@media screen and (max-width: 767px) {
  .Carousel--hero .slick-slider .slick-dots {
    bottom: auto !important;
    top: 0 !important; } }
.Carousel--hero .slick-slider .slick-dots li button:before {
  background-color: #fff;
  box-shadow: 0 0 7px #000; }
.spinner {
  position: absolute;
  top: 50%;
  left: 50%;
  margin: 0 0 0 -10px;
  text-indent: -9999em;
  width: 1em;
  height: 1em;
  border-radius: 50%;
  background: #9b9b9b;
  background: -moz-linear-gradient(left, #9b9b9b 10%, rgba(155, 155, 155, 0) 42%);
  background: -webkit-linear-gradient(left, #9b9b9b 10%, rgba(155, 155, 155, 0) 42%);
  background: -o-linear-gradient(left, #9b9b9b 10%, rgba(155, 155, 155, 0) 42%);
  background: -ms-linear-gradient(left, #9b9b9b 10%, rgba(155, 155, 155, 0) 42%);
  background: linear-gradient(to right, #9b9b9b 10%, rgba(155, 155, 155, 0) 42%);
  position: relative;
  -webkit-animation: load3 0.5s infinite linear;
  animation: load3 0.5s infinite linear;
  -webkit-transform: translateZ(0);
  -ms-transform: translateZ(0);
  transform: translateZ(0); }

.spinner:before {
  width: 50%;
  height: 50%;
  background: #9b9b9b;
  border-radius: 100% 0 0 0;
  position: absolute;
  top: 0;
  left: 0;
  content: ''; }

.spinner:after {
  background: #fff;
  width: 75%;
  height: 75%;
  border-radius: 50%;
  content: '';
  margin: auto;
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
  right: 0; }

@-webkit-keyframes load3 {
  0% {
    -webkit-transform: rotate(0deg);
    transform: rotate(0deg); }
  100% {
    -webkit-transform: rotate(360deg);
    transform: rotate(360deg); } }

@keyframes load3 {
  0% {
    -webkit-transform: rotate(0deg);
    transform: rotate(0deg); }
  100% {
    -webkit-transform: rotate(360deg);
    transform: rotate(360deg); } }

