function getBrowserInfo () {
  //currently using bowser....
  var detectedBrowserData = bowser;

  var browserDataObject = {};

  browserDataObject.name = detectedBrowserData.name;
  browserDataObject.version = detectedBrowserData.version;
  //special case for mobile
  if(isMobile())
  {
    if(browserDataObject.name == "Chrome"){
      browserDataObject.name = "Chrome Mobile";
    }
    if(browserDataObject.name == "Windows Phone"){
      browserDataObject.name = "Internet Explorer Mobile";
    }
    if(browserDataObject.name == "iPhone" ||
      browserDataObject.name == "iPad" ||
      browserDataObject.name == "iPod"){
      browserDataObject.name = "Safari Mobile";
    }
  }

  return browserDataObject;
}

function getBrowserName(){
  return getBrowserInfo().name;
}

function getBrowserVersion(){
  return getBrowserInfo().version;
}

function getURLParameter(sParam)
{
  var sPageURL = window.location.search.substring(1);
  return sPageURL.substr(sPageURL.indexOf('=')+1);
}

function checkForFacebookWebviewer() {
  var userAgent = navigator.userAgent;
  return userAgent.charAt(userAgent.indexOf('OS ')+3);
}

function isBrowserSupported () {
//default to true if unknown
  var isSupported=true;
  var browserData=getBrowserInfo();

  if ((browserData !== undefined) && (browserData !== null)){

    var currentBrowserName=browserData.name;
    var currentBrowserVersion=browserData.version;

    if (currentBrowserVersion == undefined) {
      currentBrowserVersion = checkForFacebookWebviewer();
    }

    var foundResult = null;
    var arrayLength = supportedBrowsers.length;
    var currObj = null;
    var found = false;
    for (var i = 0; ((i < arrayLength)&&(!found)); i++) {
      currObj = supportedBrowsers[i];
      if(currObj.name == currentBrowserName){
        foundResult = currObj;
        found = true;
      }
    }
    if(found)
    {
      var minSupportedVersion = foundResult.minVersion;
      if(parseFloat(currentBrowserVersion) >= parseFloat(minSupportedVersion)){
        isSupported = true;
      }
      else{
        isSupported=false;
      }
    }
    else {
      isSupported = false;
    }
  }
  return isSupported;
}

function createCookie(name,value,days) {
  if (days) {
    var date = new Date();
    date.setTime(date.getTime()+(days*24*60*60*1000));
    var expires = "; expires="+date;
  }
  else var expires = "";
  document.cookie = name+"="+value+expires+"; path=/";
}

function readCookie(name) {
  var nameEQ = name + "=";
  var ca = document.cookie.split(';');
  for(var i=0;i < ca.length;i++) {
    var c = ca[i];
    while (c.charAt(0)==' ') c = c.substring(1,c.length);
    if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length,c.length);
  }
  return null;
}

function isMobile() {
  return navigator.userAgent.indexOf('Mobile') > -1;
}

function checkForMobile() {
  if(isMobile()) {
      document.getElementById('contentBox').className = 'staticContent -unsupported-page-responsive';
      document.getElementById('grid-wrap').id = '';
  }
}

function isMonitoringTool() {
  var userAgent = navigator.userAgent;
  return (userAgent.indexOf('GomezAgent') > -1 || userAgent.indexOf('KHTE') > -1 || userAgent.indexOf('KTXN') > -1);
}

