var disqualifiers = currentLocation.toLowerCase().indexOf('/unsupported');
var bypassCookie = readCookie("bypassUnsupportedBrowser");
var currentBrowserSupported = isBrowserSupported();

if((disqualifiers > 0) && currentBrowserSupported){
  window.location.href="/";
}

if(!currentBrowserSupported && (disqualifiers <= 0) && (bypassCookie == null) && !isMonitoringTool()){
    unsupportedBrowserForm = document.createElement('FORM');
    unsupportedBrowserForm.name = 'myForm';
