    callBackURLInput=document.createElement('INPUT');
    callBackURLInput.type = 'HIDDEN';
    callBackURLInput.name = 'callbackUrl';
    callBackURLInput.value = encodeURI(currentLocation);
    unsupportedBrowserForm.appendChild(callBackURLInput);
    unsupportedBrowserForm.submit();
}

